import React from 'react';
import { useEffect, useState, useRef } from "react";
import {
  Dialog,
  DialogActions,
  DialogContent,
  DialogContentText,
  Button,
  DialogTitle
} from "@material-ui/core";
import "./dialog.scss";




export default function DialogProjectStart({showModal,handleClose,content}) {

const[seeDeomo,setSeeDemo]=React.useState(false);

  return (

      <Dialog
        open={showModal}
        disableBackdropClick
        disableEscapeKeyDown
        aria-labelledby="dialog-title"
        aria-describedby="dialog-description"
        id="dialog-project-start"
      >
        <div id="dialog-title">
          Hi!, Wanna play a Memory Game? 
        </div>
        <DialogContent>
          <DialogContentText id="dialog-description">
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <div className='project-btn' onClick={handleClose}>
            let's start!
          </div>
          <div className='project-btn' onClick={handleClose}>
            maybe later
          </div>
        </DialogActions>
      </Dialog>
  );
}
